uid: microsoft.quantum.logical.notequall
name: NotEqualL
type: function
namespace: Microsoft.Quantum.Logical
summary: Restituisce true se e solo se due input non sono uguali.
remarks: >-
  Gli elementi seguenti sono equivalenti:


  ```Q#

  let cond = a != b;

  let cond = NotEqualL(a, b);

  ```
syntax: 'function NotEqualL (a : BigInt, b : BigInt) : Bool'
input:
  content: '(a : BigInt, b : BigInt)'
  types:
  - name: a
    summary: Primo valore da confrontare.
    isPrimitive: true
    uid: BigInt
  - name: b
    summary: Secondo valore da confrontare.
    isPrimitive: true
    uid: BigInt
output:
  content: Bool
  types:
  - summary: '`true` se e solo se `a` Ã¨ diverso da `b`.'
    isPrimitive: true
    uid: Bool
